import React, { useEffect } from "react";

const ChatMessages = (props) => {
  const msgs = props.message;
  return (
    <div id="chat-card-wrapper" key={msgs.timeStamp}>
      {msgs.message}
    </div>
  );
};

export default ChatMessages;
